text:
b'Suatu hari de\xe2\x80\x99e pernah ngomong neng aku ngene;

\xe2\x80\x9cMas, rasah aplut-aplut an foto lagi bareng ya. Ben do kaget ngko nek ujug-ujug awakdewe langsung rabi\xe2\x80\x9d

\xe2\x80\x9cIyaaa sayang \xe2\x9d\xa4\xef\xb8\x8f\xe2\x80\x9d'

b'Quote terbest menurutku;

Sing mbendino kesel mergo kerjone abot. Eling, neng njobo kono iseh akeh sing ra kerjo..

Tapi duite akeh.'

b'Aku pas neng nggon mantenan;

Golek sop \xe2\x9d\x8c
Ngejak boomerang sing manten ben isoh di aplut neng instastory, agar mereka tahu kalo diri ini sudah dewasa.\xe2\x9c\x94\xef\xb8\x8f'

b'aktivitas poso dino pertama;

Awan tuku bahan dinggo dimasak, sorene dimasak, siap hindangkan. \xe2\x9d\x8c\xe2\x9d\x8c\xe2\x9d\x8c

Awan turu, sore turu, pas wayah buko tuku takjil neng pinggir ndalan. \xe2\x9c\x94\xef\xb8\x8f\xe2\x9c\x94\xef\xb8\x8f\xe2\x9c\x94\xef\xb8\x8f'

b'Aku nek malem minggu;

Dandan rapi, ngapeli yhange \xe2\x9d\x8c\xe2\x9d\x8c
Nggawe story foto dolan wingi ben dikiro lagi malem minggu. \xe2\x9c\x94\xef\xb8\x8f\xe2\x9c\x94\xef\xb8\x8f'

b'Sing tak bayangke pas lagi raup;

Bayang-bayang masalalu \xe2\x9d\x8c\xe2\x9d\x8c
Kuntilanak, pocong, sejenise \xe2\x9c\x94\xef\xb8\x8f\xe2\x9c\x94\xef\xb8\x8f'

b'Sing marai deg-degan wong lanang;

1. \xe2\x80\x9cAku pengen ngomong sesuatu\xe2\x80\x9d
2. \xe2\x80\x9cAku telat m\xe2\x80\x9d'

b'Ono 2 tipe wong neng ndonya iki;

1. Sing iseh nyimpen foto mantane neng dompet, neng galery, neng cloud, dsb.
2. Sing blas ra nyimpen opo-opo sing ono hubungane karo mantan.'

b'Cinta bertepuk sebelah timeline;

Sing lanang kerep posting foto bareng,
Tapi sing wedok ngetoki nek awake jomblo.'

b'Jodoh kuwi mungkin;
Sing tetep neng sandingmu, lan ora pindah panggon senajan awakmu mambu kecut.

Mergo mambu awakmu kuwi sing selalu nggawe kangen de\xe2\x80\x99e, pas kowe lagi sibuk utowo ora lagi bareng.'
